import React from 'react';
import './index.css'
import Item from '../Item';

class List extends React.Component {
  
    render() {
        const {todos}=this.props
        console.log(todos)
        return (
            <ul className="todo-main">
       { todos.map( (todo) =>{           
            return <Item  key={todo.id} {...todo} /> 
        })
       }
      </ul>
        )
    }
}

export default List;
